import { createGlobalStyle } from "styled-components";

export default createGlobalStyle`
    @font-face {
        font-family: 'MyWebFont';
        src:  url('myfont.woff2') format('woff2'),
        url('myfont.woff') format('woff');
}

    body {
        margin: 0;
        padding: 0;
    }
`;
